import React from 'react';

const LocationInfo = ({name,type,population,dimension}) => {
    return (
        <ul>
            <li>Name:{name}</li>
            <li>Type:{type}</li>
            <li>Population:{population}</li>
            <li>Dimension:{dimension}</li>
        </ul>
    );
};

export default LocationInfo;
